sys_variable_value.value:
(function execute(inputs, outputs) {
  	var catItems = [];
  	var catObj = {};
	var grOG = new GlideRecord("sc_cat_item_guide_items");
  	grOG.addEncodedQuery('guide=' + inputs.order_guide.getUniqueValue());
  	grOG.query();

  	while (grOG.next()) {
    	var obj = {};
    	obj.catItemId = grOG.getValue("item");
      	obj.catItemName = grOG.item.getDisplayValue();
      	catItems.push(obj);
    }

  catObj.items = catItems;
  outputs.catalog_items = catObj;
})(inputs, outputs);

